import './App.css';
import React from 'react';
import PersistentDrawerLeft from './Components/searchnav/side_navbar';


function App() {
  return (
    <div className="App1">
      <div className="App2">
        <PersistentDrawerLeft />
      </div>
      <Box component="span" m={1}>
        <Button />
      </Box>
    </div>
  );
}

export default App;
